(25, 1, '2019-07-23 14:34:46', '2019-07-23 11:34:46', '<!-- wp:heading -->\n<h2>Read more H2</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p> Unicode is an international not-for-profit organisation that started in the 1980s as an effort to \"unify\" the \"codes\" for textual characters used in the computing industry. By \"code\", I just mean a number. Computers only understand numbers, and so you need to tell the computer which number refers to the letter \"a\", which one refers to the letter \"b\", etc. so that you can visualise them on a computer screen (otherwise you\'d be reading ones and zeros right now). </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h3>Read more H3 </h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>So the problem in the 1980s was that there wasn\'t a universally agreed- upon set of \"rules\" for which number refers to which character, and so every programmer was writing their own set of rules, and whenever their programs interacted with programs written by other programmers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Okay, so how does this relate to generating small text? </li><li>Well, as it turned out, there were </li><li>Bunch of people that weren\'t too interested in Unicode. </li><li>They had specific character</li><li>So in order to</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Unicode is an international not-for-profit organisation that started in the 1980s as an effort to \"unify\" the \"codes\" for textual characters used in the computing industry. By \"code\", I just mean a link number for textual Computers only understand numbers, and so you need to tell the computer which number refers to the letter \"a\", which one refers to the letter \"b\", etc. so that you can visualise them on a computer screen (otherwise you\'d be reading ones and zeros right now). So the problem in the 1980s was that there wasn\'t a universally agreed- upon set of \"rules\" for which number refers to which character, and so every programmer was writing their own set of rules, and whenever their programs interacted with programs written by other programmers, they\'d need to make specially designed \"translators\" to allow the programs to communicate. Unicode sought to solve this by creating an international standard - meaning that everyone would be using the same number-to- letter \"rule book\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Unicode is an international not-for-profit organisation that started in the 1980s as an effort to \"unify\" the \"codes\" for textual.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:image {\"id\":62} -->\n<figure class=\"wp-block-image\"><img src=\"http://aussie-casino.local/wp-content/uploads/2019/07/day-light-summer-new-york-manhattan-times-square-street-life-4k-usa_nkzuimaql__F0000-1024x576.jpg\" alt=\"\" class=\"wp-image-62\"/></figure>\n<!-- /wp:image -->', 'On Foot: Mountain Running to Europe’s Highest Village', '', 'publish', 'open', 'open', '', 'test1', '', '', '2019-10-22 15:37:03', '2019-10-22 12:37:03', '', 0, 'http://aussie-casino.local/?p=25', 0, 'post', '', 0),
